import React from "react";
import { Link } from 'react-router-dom';

function NavBar() {
    return (
        <nav style={{ padding: '1rem', background: '#eee' }}>
            <Link to="/" style={{ marginRight: '1rem' }}>Home</Link>
            <Link to="/Nova">Nova Receita</Link>
        </nav>
    );
}
export default NavBar;
